import React from "react";
import linkedin from './linkedin.jfif';
import qublogo from './qublogo.png';

const FooterPage = () => {
    return (
        <div class="d-flex flex-column">
            <footer class="footer">
                <div>
                <a href="www.qub.ac.uk" ><img src={qublogo} width="100" height="50" class="rounded float-left"></img></a>
                    <span class="rounded float-right">&emsp;</span>
                    <a href="www.linkedin.com/in/anthony-considine-03486056/" ><img src={linkedin} width="25" height="25" class="rounded float-right"></img></a>
                    <span class="rounded float-right"> &copy; 2021 AnthonyConsidine &emsp; &emsp;</span>
                </div>
            </footer>
        </div>
    );
}

export default FooterPage;
